import React from 'react';

function HomeUtilisateur() {
  return (
    <div>
      <h1>Bienvenue sur la page d'accueil utilisateur</h1>
      <p>Cette page est réservée aux utilisateurs.</p>
    </div>
  );
}

export default HomeUtilisateur;
